import React, { useState } from 'react';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  TableSortLabel,
  Paper,
  TablePagination,
  Collapse,
  IconButton,
  Box,
  Avatar,
  Typography
} from '@mui/material';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import KeyboardArrowUpIcon from '@mui/icons-material/KeyboardArrowUp';
import { getColumns } from './columns';
import { trackUserInteraction } from '../../utils/analytics';
import ExpandedRow from './ExpandedRow';
import { TrendingUp as TrendingUpIcon, TrendingDown as TrendingDownIcon } from '@mui/icons-material';
import { useTheme } from '@mui/material/styles';

const Row = ({ pair, columns }) => {
  const [open, setOpen] = useState(false);
  const theme = useTheme();

  const handleRowClick = () => {
    setOpen(!open);
    trackUserInteraction.pairClick(pair.pairName);
  };

  return (
    <>
      <TableRow
        hover
        sx={{
          cursor: 'pointer',
          transition: 'all 0.2s',
          '& > td': {
            p: 1.5,
            border: 0,
            bgcolor: pair.is_blacklisted ? 'error.lighter' : 'background.paper',
            '&:first-of-type': {
              borderTopLeftRadius: 1,
              borderBottomLeftRadius: open ? 0 : 1,
            },
            '&:last-of-type': {
              borderTopRightRadius: 1,
              borderBottomRightRadius: open ? 0 : 1,
            }
          },
          '&:hover': {
            '& > td': {
              bgcolor: pair.is_blacklisted ? 'error.light' : 'background.default',
            },
            '& .expand-icon': {
              color: 'primary.main',
            }
          },
          mb: 0.5,
        }}
        onClick={handleRowClick}
      >
        {columns.map((column, index) => (
          <TableCell
            key={column.id}
            align={column.numeric ? 'right' : 'left'}
            sx={{
              fontSize: '0.875rem',
              color: column.highlight ? 'primary.main' : 'text.primary',
            }}
          >
            {column.id === 'priceChange' ? (
              <Box
                sx={{
                  display: 'inline-flex',
                  alignItems: 'center',
                  gap: 0.5,
                  color: (pair[column.id] || 0) >= 0 ? 'success.main' : 'error.main'
                }}
              >
                {(pair[column.id] || 0) >= 0 ? 
                  <TrendingUpIcon fontSize="small" /> : 
                  <TrendingDownIcon fontSize="small" />
                }
                <Typography variant="body2" sx={{ fontWeight: 500 }}>
                  {(pair[column.id] || 0) >= 0 ? '+' : ''}{(pair[column.id] || 0)?.toFixed(2)}%
                </Typography>
              </Box>
            ) : column.id === 'volume' || column.id === 'liquidity' ? (
              <Typography variant="body2" sx={{ fontWeight: 500 }}>
                ${(pair[column.id] || 0).toLocaleString()}
              </Typography>
            ) : (
              <Box sx={{ 
                display: 'flex', 
                alignItems: 'center',
                gap: 1,
                color: pair.is_blacklisted ? 'error.main' : 'text.primary',
              }}>
                {index === 0 && (
                  <IconButton
                    size="small"
                    className="expand-icon"
                    sx={{
                      transition: 'all 0.2s',
                      transform: open ? 'rotate(-180deg)' : 'rotate(0)',
                      color: open ? 'primary.main' : 'text.secondary',
                    }}
                  >
                    <KeyboardArrowDownIcon />
                  </IconButton>
                )}
                {column.render ? column.render(pair) : pair[column.id]}
              </Box>
            )}
          </TableCell>
        ))}
      </TableRow>
      <TableRow>
        <TableCell
          colSpan={columns.length}
          sx={{
            p: 0,
            border: 0,
            bgcolor: 'background.default',
            borderBottomLeftRadius: open ? 1 : 0,
            borderBottomRightRadius: open ? 1 : 0,
          }}
        >
          <Collapse in={open} timeout="auto" unmountOnExit>
            <Box sx={{ p: 3 }}>
              <ExpandedRow pair={pair} />
            </Box>
          </Collapse>
        </TableCell>
      </TableRow>
    </>
  );
};

const PairsTable = ({
  pairs,
  orderBy,
  order,
  page,
  rowsPerPage,
  handleSort,
  handleChangePage,
  handleChangeRowsPerPage,
  totalCount
}) => {
  const columns = getColumns();

  return (
    <TableContainer
      component={Paper}
      sx={{
        boxShadow: 2,
        borderRadius: 2,
        bgcolor: 'background.default',
        '& .MuiTable-root': {
          borderCollapse: 'separate',
          borderSpacing: '0 4px'
        }
      }}
    >
      <Table size="small" aria-label="pairs table">
        <TableHead>
          <TableRow
            sx={{
              '& th': {
                border: 0,
                p: 1.5,
                color: 'text.secondary',
                fontWeight: 600,
                fontSize: '0.75rem',
                bgcolor: 'transparent',
                whiteSpace: 'nowrap'
              }
            }}
          >
            {columns.map((column) => (
              <TableCell
                key={column.id}
                align={column.numeric ? 'right' : 'left'}
                sortDirection={orderBy === column.id ? order : false}
                onClick={() => handleSort(column.id)}
                sx={{
                  cursor: 'pointer',
                  '&:hover': {
                    color: 'primary.main'
                  }
                }}
              >
                <TableSortLabel
                  active={orderBy === column.id}
                  direction={orderBy === column.id ? order : 'asc'}
                >
                  {column.label}
                </TableSortLabel>
              </TableCell>
            ))}
          </TableRow>
        </TableHead>
        <TableBody>
          {pairs.map((pair) => (
            <Row
              key={pair.address}
              pair={pair}
              columns={columns}
            />
          ))}
        </TableBody>
      </Table>
      <TablePagination
        rowsPerPageOptions={[10, 25, 50, 100]}
        component="div"
        count={totalCount}
        rowsPerPage={rowsPerPage}
        page={page}
        onPageChange={handleChangePage}
        onRowsPerPageChange={handleChangeRowsPerPage}
        sx={{
          borderTop: 1,
          borderColor: 'divider',
          '& .MuiTablePagination-select': {
            bgcolor: 'background.paper',
            borderRadius: 1,
          }
        }}
      />
    </TableContainer>
  );
};

export default PairsTable;
